    const [Gestor,setGestor]= useState({
        Nombre_Sucursal:'',
        Descripcion:''
    })

    const navigate = useNavigate();

    const teclaPresionada = (e) => {
        const { name, value } = e.target
        console.log(name)
        setGestor({ ...Gestor, [name]: value })
    }
}
